    const data = async() => {
        const res = await fetch('https://jsonplaceholder.typicode.com/posts');
        const db = await res.json();
        // return db.filter((item , i) => { return i < 4 }) ;
        return db ;
    };
    /*useEffect(() => {
        // setTimeout( async => {
          const unsub =  async() => {
          const res = await fetch('https://jsonplaceholder.typicode.com/posts');
          const db = await res.json();
          setData( db.filter((item , i) => { return i < 4 }) );
          };
          return unsub
        // }, 2500);
      }, []);*/

    return (
        <div className={'skeletonContainer'}>{
            data.map( (item, i) => { return(
                <DataItem className={'skeletonContainer__item'} payload={item} navType={navType}/>
            ) } )
        }</div>
    )
}

export default SkeletonContainer
